import React from 'react';
import './enterNewTweet.css';
import {Textarea, Button} from '../../../form/input'

const EnterNewTweet = () => {
    return (
        <div className="EnterNewTweet">
            <Textarea className="NewMessage" placeholder="What's happening?" />
            <Button className="Make-Btn" innerHTML="Tweet"/>
        </div>
    );
}

export default EnterNewTweet;
